import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import { TweetsComponent } from "./tweets";

const appEl = document.getElementById("root");
if (appEl) {
	ReactDOM.render(
		<React.StrictMode>
			<App />
		</React.StrictMode>,
		appEl
	);
}

const e = React.createElement;

